message:
⚡️Bitcoin cerró 2022 con una caída del 64%

Históricamente, BTC nunca ha cerrado en negativo dos años seguidos 💰

▪️2011 - BTC bajó un 58%;
▪️2014 - BTC cayó 56%;
▪️2018 - BTC cayó 72%;

Estos años fueron bajistas y antecedieron al nuevo ATH. Si la tendencia continúa, los próximos 2-3 años deberían ser alcistas 📈
